import React from 'react';
import './RutgersLink.css';

const RutgersLink = () => {
  return (
    <div className="rutgers-link">
      <a 
        href="https://www.newark.rutgers.edu/" 
        target="_blank" 
        rel="noopener noreferrer"
      >
        Visit My Rutgers Newark Homepage
      </a>
    </div>
  );
};

export default RutgersLink;
